import './Expense.css'
import ExpenseItem from './ExpenseItem.js'

function Expense(props) {
  return (
    <>
      <ExpenseItem
        title={props.expense[0].title}
        amount={props.expense[0].amount}
        date={props.expense[0].date}
        className="expense"
      />
    </>
  )
}

export default Expense
